Returns the full path to the file that this entry represents.

The full path is created by joining the original path to `read_dir` with the filename of this entry.

##### [ยง](#examples)Examples

```
use std::fs;

fn main() -> std::io::Result<()> {
    for entry in fs::read_dir(".")? {
        let dir = entry?;
        println!("{:?}", dir.path());
    }
    Ok(())
}
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Ause+std::fs;%0A%0Afn+main()+-%3E+std::io::Result%3C()%3E+%7B%0A++++for+entry+in+fs::read_dir(%22.%22)?+%7B%0A++++++++let+dir+=+entry?;%0A++++++++println!(%22%7B:?%7D%22,+dir.path());%0A++++%7D%0A++++Ok(())%0A%7D&edition=2021)

This prints output like:

```text
"./whatever.txt"
"./foo.html"
"./hello_world.rs"

```

The exact text, of course, depends on what files you have in `.`.

